import React from 'react';
import { Carousel } from 'react-carousel-minimal';

const Slide = () => {

    const data = [
        {
            image: "https://scontent.fdad2-1.fna.fbcdn.net/v/t39.30808-6/p600x600/271198022_1264456490690340_7897448415727789268_n.jpg?_nc_cat=108&ccb=1-5&_nc_sid=8bfeb9&_nc_ohc=FqUZPMJ2hEEAX9C73EN&_nc_ht=scontent.fdad2-1.fna&oh=00_AT-Oz4DIWLIzeQpUIB74-XtB2jcV1z9PDL4FtMvXiFaGww&oe=61D76EEA",

        },
        {
            image: "https://scontent.fdad1-2.fna.fbcdn.net/v/t39.30808-6/271189650_1264456464023676_2616006332608025532_n.jpg?_nc_cat=102&ccb=1-5&_nc_sid=8bfeb9&_nc_ohc=qppUQJKJ6VUAX_eyrL2&_nc_ht=scontent.fdad1-2.fna&oh=00_AT9j4Oq8peCWTW1OdcDTUguGd8TA4Xd6akKyZuo_nz4e5w&oe=61D8B8A9",

        },
        {
            image: "https://scontent.fdad1-2.fna.fbcdn.net/v/t39.30808-6/271186625_1264456450690344_2308761378813144799_n.jpg?_nc_cat=105&ccb=1-5&_nc_sid=8bfeb9&_nc_ohc=V5E6o7kru84AX92oI49&_nc_ht=scontent.fdad1-2.fna&oh=00_AT92PUGHIP1msA2iuMMbdh_JzWvC_n1EdcJE877WuRIm8A&oe=61D88DE2",

        },
        {
            image: "https://upload.wikimedia.org/wikipedia/commons/thumb/1/16/Palace_of_Fine_Arts_%2816794p%29.jpg/1200px-Palace_of_Fine_Arts_%2816794p%29.jpg",

        },
        {
            image: "https://i.natgeofe.com/n/f7732389-a045-402c-bf39-cb4eda39e786/scotland_travel_4x3.jpg",
            caption: "Scotland"
        },
        {
            image: "https://www.tusktravel.com/blog/wp-content/uploads/2020/07/Best-Time-to-Visit-Darjeeling-for-Honeymoon.jpg",

        },
        {
            image: "https://www.omm.com/~/media/images/site/locations/san_francisco_780x520px.ashx",

        },
        {
            image: "https://images.ctfassets.net/bth3mlrehms2/6Ypj2Qd3m3jQk6ygmpsNAM/61d2f8cb9f939beed918971b9bc59bcd/Scotland.jpg?w=750&h=422&fl=progressive&q=50&fm=jpg",

        },
        {
            image: "https://www.oyorooms.com/travel-guide/wp-content/uploads/2019/02/summer-7.jpg",

        }
    ];


    return (
        <div className="Slide">
            <div style={{ textAlign: "center" }}>
                <h2>React Carousel Minimal</h2>
                <p>Easy to use, responsive and customizable carousel component for React Projects.</p>
                <div style={{
                    padding: "0"
                }}>
                    <Carousel
                        data={data}
                        time={1000}
                        width="auto"
                        height="500px"

                        dots={true}
                        pauseIconColor="white"
                        pauseIconSize="40px"
                        slideBackgroundColor="darkgrey"
                        slideImageFit="cover"
                    />
                </div>
            </div>
        </div>
    );
}

export default Slide;
